# Statistical distributions

## Compute the probabilities for `\(N(3.3, 1.1)\)`

&lt;img src="figure/ex-plot-1.svg" style="display: block; margin: auto;" /&gt;

---

* `\(\Pr(X &lt; 1.3)\)`


```r
pnorm(1.3, mean = 3.3, sd = 1.1)
```

```
## [1] 0.03451817
```

* `\(\Pr(X &gt; 1.9) = 1 - \Pr(X \le 1.9)\)`


```r
pnorm(1.9, mean = 3.3, sd = 1.1, lower.tail = FALSE)
```

```
## [1] 0.8984426
```

```r
1 - pnorm(1.9, mean = 3.3, sd = 1.1)
```

```
## [1] 0.8984426
```

* `\(\Pr(1.8 &lt; X &lt; 2.2) = \Pr(X &lt; 2.2) - \Pr(X &lt; 1.8)\)`


```r
pnorm(2.2, mean = 3.3, sd = 1.1) - pnorm(1.8, mean = 3.3, sd = 1.1)
```

```
## [1] 0.07231423
```

## Plot the density curves for Weibull


```r
library(ggplot2)
xgrid &lt;- seq(0, 6, 0.01)
df_weibull &lt;- data.frame(
  x = xgrid,
  y1 = dweibull(xgrid, shape = 3, scale = 1.5),
  y2 = dweibull(xgrid, shape = 2, scale = 2),
  y3 = dweibull(xgrid, shape = 1, scale = 1)
)
ggplot(data = df_weibull, aes(x = xgrid)) +
  geom_line(aes(y = y1), colour = "red") +
  geom_line(aes(y = y2), colour = "blue") +
  geom_line(aes(y = y3), colour = "orange") +
  xlab("x") +
  ylab("densities")
```

# QQ-plot

---

## Simulate sample of size `\(n = 500\)` from `\(\Gamma(4, 2)\)`


```r
set.seed(123)
n &lt;- 500
alpha &lt;- 4
beta &lt;- 2
df_gamma &lt;- data.frame(
  xgamma = rgamma(n, shape = alpha, rate = beta)
)
head(df_gamma)
```

```
##      xgamma
## 1 1.2649897
## 2 3.0404103
## 3 0.5263902
## 4 1.8730270
## 5 3.7219774
## 6 2.2077031
```

---

## QQ-Plot computation

a. Sort and standardise the sample values from low to high
b. Theoretical quantiles, `\(n=\)` sample size
`$$\begin{align}1 - 0.5^{(1/n)} \quad &amp; i=1 \\
   \frac{i - 0.3175}{n + 0.365} \quad &amp; i=2, ..., n-1 \\
   0.5^{(1/n)} \quad &amp; i=n \end{align}$$`


```r
df_gamma$xq &lt;- qgamma(
  c(1 - 0.5^(1/n), # i = 1
  (2:(n-1) - 0.3175) / (n + 0.365), # i = 2, ... , n - 1
  0.5^(1/n)), # i = n
  alpha, beta
) # theoretical quantiles
head(df_gamma)
```

```
##      xgamma        xq
## 1 1.0926928 0.1474485
## 2 2.9469747 0.1985390
## 3 0.3749567 0.2328525
## 4 1.7156590 0.2598571
## 5 3.6785302 0.2826566
## 6 2.0649844 0.3026649
```

---

c. Plot the theoretical vs sample quantiles 


```r
ggplot(data = df_gamma, aes(x = sort(xgamma), y = xq)) +
  geom_point() +
  geom_abline(intercept = 0, slope = 1) + # X = Y line
  xlab("Sample quantiles") +
  ylab("Theoretical quantiles") +
  coord_equal()
```

&lt;img src="figure/q1-c-1.svg" style="display: block; margin: auto;" /&gt;

## Compute the likelihood function

`$$\begin{aligned}
L(\alpha, \beta) &amp;=\Pr(X_1=x_1,X_2=x_2, ... ,X_n=x_n~\big\vert~\alpha, \beta) \\      
&amp;=f(x_1\big\vert\alpha, \beta)f(x_2\big\vert\alpha, \beta)\cdots f(x_n\big\vert\alpha, \beta) \\
&amp;=\prod_{i=1}^n f(x_i;\alpha, \beta)
\end{aligned}$$`


```r
nmle &lt;- function(x, alpha, beta) {
  # L(alpha, beta) = product of joint density functions
}
```




```r
alpha &lt;- seq(2.7, 3.8, 0.01)
beta &lt;- seq(1.45, 2.2, 0.01)
# all possible combinations of alpha and beta
g &lt;- expand.grid(x = alpha, y = beta) 
g$l &lt;- 0
for (i in 1:nrow(g)) {
  g$l[i] &lt;- nmle(X2$x, g$x[i], g$y[i])
}
```

## Interactive 3D surface plot using `plotly`

If you're curious about how to produce the 3D plot, here's the code:


```r
m &lt;- matrix(g$l, nrow = length(alpha))
library(plotly)
plot_ly(x = ~ beta, y = ~ alpha, z = m) %&gt;% 
  add_surface()
```

library(MASS)
